import testImage from "../svg/test.svg";

const Forecast = () => {
    return (  
        <div>
            {/* window for forecast */}
            <div>
                {/* city and forecast */}
                <div>
                    <h1>Tbilisi</h1>
                    <h5>Sunny</h5>
                    
                    <img src={testImage} alt="icon not found" />

                    <h1>31°</h1>
                </div>

                {/* todays forecast */}
                <div>
                    <div>
                        <h3>6:00 AM</h3>
                        <img src={testImage} alt="icon not found" />
                        <h2>25°</h2>
                    </div>
                </div>
            </div>
        </div>
    );
}
 
export default Forecast;
